headerButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));
let entityGroupService = $injector.get(widgetContext.servicesMap.get('entityGroupService'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));
let entityRelationService = $injector.get(widgetContext.servicesMap.get('entityRelationService'));

openAddSedeDialog();

function openAddSedeDialog() {
  customDialog.customDialog(htmlTemplate, AddSedeDialogController).subscribe();
}

function AddSedeDialogController(instance) {
  let vm = instance;

  vm.addSedeFormGroup = vm.fb.group({
    name: ['', [vm.validators.required]],
    address: ['', [vm.validators.required]]
  });

  vm.cancel = function () {
    vm.dialogRef.close(null);
  };

  vm.save = function () {
    var customerId = widgetContext.stateController.getStateParams().entityId;
    vm.addSedeFormGroup.markAsPristine();
    saveSedeObservable(customerId).subscribe(
      function (sede) {
          widgetContext.rxjs.forkJoin([
              saveCustomerToSedeRelation(customerId, sede.id),
              saveAttributes(sede.id)
          ]).subscribe(
              function () {
                var params = widgetContext.stateController.getStateParams();
                var selectedSede = params['selectedSupermarket'];
                params['selectedSupermarket'] = { entityId: sede.id, entityName: sede.name, entityLabel: '' };
                widgetContext.updateAliases();
                vm.dialogRef.close(null);
              }
        );
      }
    );
  };

  function saveSedeObservable(customerId) {
    return getSedeGroup(customerId).pipe(
        widgetContext.rxjs.switchMap((sedeGroup) => {
            const formValues = vm.addSedeFormGroup.value;
            let sede = {
              name: formValues.name,
              type: 'Sede',
              customerId: customerId
            };
            return assetService.saveAsset(sede, sedeGroup.id.id)
        })
    );
  }

  function getSedeGroup(customerId) {
      return entityGroupService.getEntityGroupsByOwnerId(customerId.entityType, customerId.id, 'ASSET').pipe(
          widgetContext.rxjs.switchMap((entityGroups) => {
              var sedeGroup = entityGroups.find(group => group.name === 'Sedi');
              if (sedeGroup) {
                  return widgetContext.rxjs.of(sedeGroup);
              } else {
                  sedeGroup = {
                      type: 'ASSET',
                      name: 'Sedi',
                      ownerId: customerId
                  };
                  return entityGroupService.saveEntityGroup(sedeGroup);
              }
          })
      );
  }

  function saveCustomerToSedeRelation(customerId, sedeId) {
