var $injector = widgetContext.$scope.$injector;
var dialogs = $injector.get(widgetContext.servicesMap.get('dialogs'));
var assetService = $injector.get(widgetContext.servicesMap.get('assetService'));
var entityRelationService = $injector.get(widgetContext.servicesMap.get('entityRelationService'));
var entityGroupService = $injector.get(widgetContext.servicesMap.get('entityGroupService'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));

var ufficioDevicesGroup = null;
var unassignedDevicesGroup = null;

openDeleteUfficioDialog();

function openDeleteUfficioDialog() {
  var title = 'Confermi di eliminare questa Ufficio: ' + entityName + '?';
  var content = 'Attenzione, dopo la conferma, i dati di questa ufficio saranno cancellati, gli uffici e i device dovrannno essere riassegnati';
  dialogs.confirm(title, content, 'Cancel', 'Delete').subscribe(
    function(result) {
      if (result) {
        deleteUfficio();
      }
    }
  );
}

function deleteUfficio() {
  var customerId;
  if (widgetContext.currentUser.authority === 'TENANT_ADMIN') {
       customerId = widgetContext.stateController.getStateParams().entityId;
  } else {
       customerId = { id: widgetContext.currentUser.customerId, entityType: 'CUSTOMER'};
  }
  var relatedDevicesQuery = {
      parameters: {
          rootId: entityId.id,
          rootType: entityId.entityType,
          direction: 'FROM'
      },
      filters: [{ relationType: 'Contains', entityTypes: ['DEVICE'] }]
  };
  entityRelationService.findByQuery(relatedDevicesQuery).subscribe((relatedDevicesRelations) => {
      var removeDevicesObservables = [];
      relatedDevicesRelations.forEach((deviceRelation) => {
          removeDevicesObservables.push(removeDevice(deviceRelation.to, customerId));
      });
      var removeDevicesObservable = removeDevicesObservables.length ? widgetContext.rxjs.forkJoin(removeDevicesObservables) : widgetContext.rxjs.of(null);
      removeDevicesObservable.subscribe(() => {
          assetService.deleteAsset(entityId.id).subscribe(
            function() {
                widgetContext.updateAliases();
            }
          );
      });
  });
}

function removeDevice(deviceId, customerId) {
    return getCustomerDeviceGroups(customerId).pipe(
        widgetContext.rxjs.switchMap((groups) => {
            var ufficioDevices = groups[0];
            var unassignedDevices = groups[1];
            return widgetContext.rxjs.forkJoin([
                entityGroupService.removeEntityFromEntityGroup(ufficioDevices.id.id, deviceId.id),
                entityGroupService.addEntityToEntityGroup(unassignedDevices.id.id, deviceId.id),
                deleteUfficioToDeviceRelation(deviceId),
                removePositionAttributes(deviceId)
            ]);
        })
    );
}

function getCustomerDeviceGroups(customerId) {
    if (ufficioDevicesGroup === null) {
        return entityGroupService.getEntityGroupsByOwnerId(customerId.entityType, customerId.id, 'DEVICE').pipe(
            widgetContext.rxjs.switchMap((deviceEntityGroups) => {
                return getUnassignedDevicesGroup(customerId, deviceEntityGroups).pipe(
                    widgetContext.rxjs.switchMap((_unassignedDevicesGroup) => {
                        ufficioDevicesGroup = getUfficioDevicesGroup(deviceEntityGroups);
                        unassignedDevicesGroup = _unassignedDevicesGroup;
                        return widgetContext.rxjs.of([ufficioDevicesGroup, unassignedDevicesGroup]);
                    })
                );
            })
        );
    } else {
        return widgetContext.rxjs.of([ufficioDevicesGroup, unassignedDevicesGroup]);
    }
}

function getUfficioDevicesGroup(groups) {
  return groups.find(group => group.name === 'Devices Ufficio');
}

function getUnassignedDevicesGroup(customerId, groups) {
  var unassignedDevicesGroup = groups.find(group => group.name === 'Ufficio non assegnata');
  if (unassignedDevicesGroup) {
      return widgetContext.rxjs.of(unassignedDevicesGroup);
  } else {
      unassignedDevicesGroup = {
          type: 'DEVICE',
          name: 'Ufficio non assegnata',
          ownerId: customerId
      };
      return entityGroupService.saveEntityGroup(unassignedDevicesGroup);
  }
}

function deleteUfficioToDeviceRelation(deviceId) {
    return entityRelationService.deleteRelation(entityId, 'Contains', deviceId);
}

function removePositionAttributes(entityId) {
    return attributeService.deleteEntityAttributes(entityId, "SERVER_SCOPE", [{key: 'xPos'},{key: 'yPos'}]);
}

